import React from "react";
import { Bar } from "react-chartjs-2";
import { Chart as ChartJS } from 'chart.js/auto'

const BarChart = () => {
    return (
        <div>
            <Bar
                data={{
                    labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange'],
                }}
                width={600}
                height={400}
                options={{ maintainAspectRatio: false }}
            />
        </div>
    );
};
export default BarChart;
